operations._screen_block:
function() {var activePromptIndicies = [];
activePromptIndicies.push(0);
activePromptIndicies.push(1);

return activePromptIndicies;
}

function() {var activePromptIndicies = [];
if (data('ADA') == null) {
activePromptIndicies.push(2);
}
if (adate.ageInYears(data('ADA'))>=2) {
activePromptIndicies.push(3);
}
else {
activePromptIndicies.push(4);
}
if (!adate.yearUnknown(data('ADA'))) {
activePromptIndicies.push(5);
activePromptIndicies.push(6);
}
else {
activePromptIndicies.push(7);
}

return activePromptIndicies;
}
